import "./presentation.scss";
import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";
import { init } from 'ityped'
import React, { useEffect, useRef } from "react";
export default function Presentation() {

  const textRef = useRef();

  useEffect(()=>{
    init(textRef.current, {
      showCursor: false,
      strings: ["Sous les Cieux","De tout les temps","Qui brille tellement"],
    });
  }, []);


  return (
    <div className="presentation" id="presentation">
      <div className="left">
        <div className="imgContainer">
          <img src="assets/shib.png" alt="" />
        </div>
      </div>
      <div className="right">
        <div className="wrapper">
          <h2>Bonjour, je suis</h2>
          <h1>Le Général Ouki</h1>
          <h3>Grand général <span ref={textRef}></span></h3>
          <a className="arrow" href="#portfolio">
            <KeyboardArrowDownIcon className="icone" />
          </a>
        </div>
      </div>
    </div>
  );
}
